import React, { useState, useEffect, useCallback } from "react";
import { QueryClient, QueryClientProvider } from "react-query";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  useLocation,
  useNavigate,
} from "react-router-dom";
import IngredientList from "./components/IngredientList";
import ExpirationPage from "./components/ExpirationPage";
import SearchBar from "./components/SearchBar";
import IngredientDetails from "./components/IngredientDetails";
import MenuSubstitutions from "./components/MenuSubstitutions";
import AddIngredient from "./components/AddIngredient";
import AddIngredientButton from "./components/AddIngredientButton";
import GroceryListPage from "./components/GroceryListPage";
import axios from "axios";
import "./index.css";

const queryClient = new QueryClient();

function AppContent() {
  const [searchQuery, setSearchQuery] = useState("");
  const [activeTab, setActiveTab] = useState("inventory");
  const [ingredients, setIngredients] = useState([]);
  const [groceryList, setGroceryList] = useState([]);

  const location = useLocation();
  const navigate = useNavigate();

  const fetchIngredients = useCallback(async () => {
    try {
      const response = await axios.get("http://127.0.0.1:8000/ingredients");
      if (Array.isArray(response.data.ingredients)) {
        setIngredients(response.data.ingredients);
      }
    } catch (error) {
      console.error("Error fetching ingredients:", error);
    }
  }, []);

  useEffect(() => {
    fetchIngredients();
  }, [fetchIngredients]);

  useEffect(() => {
    if (location.pathname === "/expiration") {
      setActiveTab("expiration");
    } else if (location.pathname === "/menu-sub") {
      setActiveTab("menu-sub");
    } else if (location.pathname === "/grocery") {
      setActiveTab("grocery");
    } else {
      setActiveTab("inventory");
    }
  }, [location.pathname]);

  const handleExportCSV = () => {
    const table = document.querySelector("table");
    if (!table) return;

    const csv = Array.from(table.querySelectorAll("tr"))
      .map((row) =>
        Array.from(row.querySelectorAll("th, td"))
          .map((col) => col.innerText.trim())
          .join(",")
      )
      .join("\n");

    const link = document.createElement("a");
    link.href = `data:text/csv;charset=utf-8,${encodeURIComponent(csv)}`;
    link.download = "filtered_data.csv";
    document.body.appendChild(link);
    link.click();
  };

  return (
    <>
      <div className="navbar">Neighborhood Meals on Wheels Inventory Application</div>

      <div className="tabs-container">
        <button className={`tab-button ${activeTab === "inventory" ? "active" : ""}`} onClick={() => navigate("/")}>Inventory</button>
        <button className={`tab-button ${activeTab === "expiration" ? "active" : ""}`} onClick={() => navigate("/expiration")}>Expiration</button>
        <button className={`tab-button ${activeTab === "menu-sub" ? "active" : ""}`} onClick={() => navigate("/menu-sub")}>Menu Sub</button>
        <button className={`tab-button ${activeTab === "grocery" ? "active" : ""}`} onClick={() => navigate("/grocery")}>Grocery List</button>
      </div>

      <div className="search-export-container">
        <SearchBar setSearchQuery={setSearchQuery} />
        <button className="export-btn" onClick={handleExportCSV}>Export to CSV</button>
      </div>

      <div className="p-6">
        <Routes>
          <Route path="/" element={
            <>
              <AddIngredientButton />
              <IngredientList searchQuery={searchQuery} ingredients={ingredients} fetchIngredients={fetchIngredients} />
            </>
          } />
          <Route path="/expiration" element={<ExpirationPage />} />
          <Route path="/menu-sub" element={<MenuSubstitutions setGroceryList={setGroceryList} />} />
          <Route path="/grocery" element={<GroceryListPage groceryList={groceryList} />} />
          <Route path="/ingredient/:barcode" element={<IngredientDetails />} />
          <Route path="/add-ingredient" element={<AddIngredient />} />
        </Routes>
      </div>
    </>
  );
}

function App() {
  return (
    <QueryClientProvider client={queryClient}>
      <Router>
        <AppContent />
      </Router>
    </QueryClientProvider>
  );
}

export default App;
